import React from "react";
import { Link } from "react-router-dom";
import articleContent from "./article-content";

const ArticlesList = () => (
  <>
    <h1>Articles</h1>
    {articleContent.map((article) => (
      <Link>{article.title}</Link>
    ))}
  </>
);

export default ArticlesList;
